import FavoriteCard from "./FavoriteCard"

export default function FavoriteItem ({ showFavorites }) {

    const getRecipes = showFavorites.map(e => {
        return e.recipes
    })
    const getInfo = getRecipes[0].map((e, i) => <FavoriteCard key={i} {...e}/>)
    console.log(getRecipes)

    return(
        <div className="favorites-list">
            {getInfo}
        </div> 
    )
}
